import colors from './foundational-styles/colors';
import fills from './foundational-styles/fills';
import fontFamilies from './foundational-styles/fontFamilies';
import headings from './foundational-styles/headings';
import palette from './foundational-styles/palette';
import paragraph from './foundational-styles/paragraph';
import scales from './foundational-styles/scales';
import text from './foundational-styles/text';
export default {
  scales: scales,
  fills: fills,
  colors: colors,
  palette: palette,
  typography: {
    fontFamilies: fontFamilies,
    headings: headings,
    text: text,
    paragraph: paragraph
  }
};
